// ==UserScript==
// @name         Gmail Email Sent — Dark souls
// @namespace    gmail-email-sent-overlay
// @version      2.5.0
// @description  Надпись и звук после реального тоста Gmail. Стабильный WebAudio-анлок без щелчков. Один запуск на показ тоста.
// @match        https://mail.google.com/*
// @grant        none
// @run-at       document-idle
// ==/UserScript==

(function () {
  "use strict";

  const TEXT = "EMAIL SENT";
  // ====== НАСТРОЙКИ ======
  const SOUND_URL =
    "data:audio/mp3;base64,";

  const PREFIX = "email-sent-"; // screen/bg/title/glow/hide и т.д.

  const CSS_FROM_STYLE_CSS = `
/* --- начало твоего style.css --- */
/* ВСТАВЬ содержимое style.css целиком сюда (если там уже @font-face data: — оставляй) */
/* Я добавлю только безопасные правки ниже */
@font-face {
  font-family: OptimusPrinceps;
  src: url("data:font/ttf;base64,");
}

.email-sent-screen {
  position: fixed;
  top: 50%;
  left: 0;
  z-index: 1000000;
  display: flex;
  place-items: center center;
  justify-content: center;
  width: 100%;
  transform: translateY(-50%);
}

.email-sent-bg {
  position: absolute;
  width: 100%;
  height: 80px;
  background-color: #000;
  box-shadow: 0 0 0.9em 0.9em #000, 0 0 0 1024px rgb(48 48 48 / 40%);
  opacity: 1;
  animation-name: email-sent-reveal;
  animation-duration: 5s;
  animation-iteration-count: 1;
}

.email-sent-title {
  position: relative;
  top: 0;
  left: 0;
  z-index: 10;
  font-family: OptimusPrinceps, "Times New Roman", sans-serif;
  font-size: 60px;
  color: #e7c15c;
  text-shadow: 0 0 0.4em #e77c5c;
  white-space: nowrap;
  pointer-events: none;
  user-select: none;
  opacity: 1;
  animation-name: email-sent-reveal;
  animation-duration: 5s;
  animation-iteration-count: 1;
}

.email-sent-glow {
  position: absolute;
  top: 0;
  left: 0;
  z-index: 20;
  font-family: OptimusPrinceps, "Times New Roman", sans-serif;
  font-size: 60px;
  color: #e7c15c;
  white-space: nowrap;
  pointer-events: none;
  user-select: none;
  filter: blur(2px);
  opacity: 0;
  transition-timing-function: ease-in;
  animation-name: email-sent-glow;
  animation-duration: 10s;
  animation-iteration-count: 1;
}

.email-sent-hide {
  opacity: 0;
  animation-name: email-sent-hide;
  animation-duration: 2s;
  animation-iteration-count: 1;
}

@keyframes email-sent-reveal {
  0% {
    opacity: 0;
  }

  100% {
    opacity: 1;
  }
}

@keyframes email-sent-hide {
  0% {
    opacity: 1;
  }

  100% {
    opacity: 0;
  }
}

@keyframes email-sent-glow {
  0% {
    opacity: 0;
    transform: scale(1, 1);
  }

  30% {
    opacity: 0.16;
    transform: scale(1.25, 1.2) translateY(2px);
  }

  100% {
    opacity: 0;
    transform: scale(0.9, 0.9) translateY(-10px);
  }
}

/* --- конец твоего style.css --- */

/* Безопасные правки: не блокировать клики по странице */
.${PREFIX}screen { pointer-events: none !important; }
.${PREFIX}bg     { pointer-events: none !important; }

/* На всякий случай: самый высокий z-index для слоя */
.${PREFIX}screen { z-index: 2147483647 !important; }
  `.trim();

  // ====== ИНЖЕКТ СТИЛЕЙ ======
  function injectStyles() {
    if (document.getElementById("email-sent-style")) return;
    const style = document.createElement("style");
    style.id = "email-sent-style";
    style.textContent = CSS_FROM_STYLE_CSS;
    document.documentElement.appendChild(style);
  }
  injectStyles();

  // ====== АУДИО: WebAudio-анлок без слышимых кликов ======
  let audioArmed = false;
  let audioCtx = null;
  let audioBuffer = null;

  async function armAudioOnce() {
    if (audioArmed || !SOUND_URL) return;
    audioArmed = true;
    try {
      // 1) Создаем/резюмим контекст
      audioCtx = new (window.AudioContext || window.webkitAudioContext)();
      if (audioCtx.state === "suspended") {
        await audioCtx.resume();
      }
      // 2) Тихий немой импульс (разлочка без звука)
      const silentBuf = audioCtx.createBuffer(1, 1, audioCtx.sampleRate);
      const silentSrc = audioCtx.createBufferSource();
      silentSrc.buffer = silentBuf;
      silentSrc.connect(audioCtx.destination);
      silentSrc.start(0);

      // 3) Предзагрузка и декодирование твоего звука
      // data: URI можно «fetch»-нуть
      const res = await fetch(SOUND_URL);
      const arr = await res.arrayBuffer();
      audioBuffer = await new Promise((resolve, reject) => {
        // Safari до сих пор любит колбэк-API
        const decode = audioCtx.decodeAudioData.bind(audioCtx);
        decode(arr, resolve, reject);
      });
    } catch (e) {
      // Если что-то пошло не так — просто оставим без буфера; потом fallback'ом сыграем через <audio>
      // Но повторять анлок больше не будем (audioArmed=true), чтобы не клацать ещё раз
    }
  }

  // Взводим на первом жесте пользователя, без звука
  function attachArmListeners() {
    const opts = { once: true, capture: true };
    ["pointerdown", "keydown", "touchstart"].forEach((ev) =>
      document.addEventListener(ev, armAudioOnce, opts)
    );
  }
  attachArmListeners();

  function playSound() {
    if (!SOUND_URL) return;

    // Приоритет — WebAudio (без артефактов)
    if (audioCtx && audioBuffer) {
      try {
        const src = audioCtx.createBufferSource();
        src.buffer = audioBuffer;
        const gain = audioCtx.createGain();
        gain.gain.value = 0.35; // громкость
        src.connect(gain).connect(audioCtx.destination);
        src.start(0);
        return;
      } catch (_) {
        /* упадём на fallback ниже */
      }
    }

    // Fallback: обычный <audio>, НО без анлока-трюков (никаких play/pause заранее)
    try {
      const el = new Audio(SOUND_URL);
      el.volume = 0.35;
      el.play().catch(() => {});
    } catch (_) {}
  }

  // ====== РЕНДЕР ======
  function showOverlay() {
    const container = document.createElement("div");
    container.classList.add(`${PREFIX}screen`);

    const bg = document.createElement("div");
    bg.className = `${PREFIX}bg`;

    const wrapper = document.createElement("div");
    wrapper.style.position = "relative";

    const title = document.createElement("span");
    title.className = `${PREFIX}title`;
    title.textContent = TEXT;

    let glowHTML = "";
    for (let i = 0; i < 8; i++) {
      const time = (8 + i / 2).toFixed(1);
      const delay = (i / 15).toFixed(1);
      glowHTML += `<span style="animation-duration:${time}s;animation-delay:${delay}s" class="${PREFIX}glow">${TEXT}</span>`;
    }

    wrapper.appendChild(title);
    container.appendChild(bg);
    container.appendChild(wrapper);
    wrapper.insertAdjacentHTML("beforeend", glowHTML);

    document.body.appendChild(container);
    try {
      playSound();
    } catch {}

    setTimeout(() => {
      container.classList.add(`${PREFIX}hide`);
      setTimeout(() => container.remove(), 20000);
    }, 5000);
  }

  // ====== ДЕТЕКТ ТОСТА GMAIL (armed/disarmed) ======
  const SENT_PATTERNS = [
    /Message sent\.?/i,
    /Email sent\.?/i,
    /Message has been sent/i,
    /Your message has been sent/i,
    /Сообщение отправлено\.?/i,
    /Письмо отправлено\.?/i,
    /Отправлено/i,
  ];

  const TOAST_SELECTOR =
    'span.bAq,div.b8.UC.bAp[role="alert"][aria-live="assertive"]';

  let armed = true;
  let rearmTimer = null;
  let lastFireAt = 0;

  function toastPresent() {
    return !!document.querySelector(TOAST_SELECTOR);
  }

  function scheduleRearm() {
    if (rearmTimer) return;
    rearmTimer = setInterval(() => {
      if (!toastPresent()) {
        armed = true;
        clearInterval(rearmTimer);
        rearmTimer = null;
      }
    }, 250);
  }

  function tryTriggerFrom(node) {
    if (!armed) return;
    const el = node instanceof HTMLElement ? node : null;
    if (!el) return;

    const toastEl = el.matches(TOAST_SELECTOR)
      ? el
      : el.closest(TOAST_SELECTOR);
    if (!toastEl) return;

    const txt = (toastEl.textContent || "").trim();
    if (!txt || !SENT_PATTERNS.some((re) => re.test(txt))) return;

    const now = Date.now();
    if (now - lastFireAt < 500) return;

    lastFireAt = now;
    armed = false;
    showOverlay();
    scheduleRearm();
  }

  const observer = new MutationObserver((muts) => {
    for (const m of muts) {
      for (const node of m.addedNodes) {
        if (node instanceof HTMLElement) {
          if (node.matches?.(TOAST_SELECTOR)) tryTriggerFrom(node);
          node.querySelectorAll?.(TOAST_SELECTOR).forEach(tryTriggerFrom);
        }
      }
      if (m.type === "characterData") {
        const el = m.target && m.target.parentElement;
        if (el) tryTriggerFrom(el);
      }
    }
  });

  function startObserver() {
    const body = document.body;
    if (!body) return;
    observer.observe(body, {
      childList: true,
      subtree: true,
      characterData: true,
    });
  }
  if (document.readyState === "loading") {
    document.addEventListener("DOMContentLoaded", startObserver, {
      once: true,
    });
  } else {
    startObserver();
  }

  // РЕЗЕРВ: мягкий поллинг (учитывает armed)
  const pollId = setInterval(() => {
    if (!armed) return;
    const el = document.querySelector(TOAST_SELECTOR);
    if (el) tryTriggerFrom(el);
  }, 400);
  setTimeout(() => clearInterval(pollId), 2 * 60 * 1000);

  // ====== ТЕСТ ======
  window.addEventListener("message", (e) => {
    if (e && e.data && e.data.type === "GESO_TEST") showOverlay();
  });
  document.addEventListener("GESO_TEST", () => showOverlay());
})();
